-- 导出  函数 cbs-dev.SeparateLettersAndNumbers 结构
DELIMITER //
CREATE FUNCTION `SeparateLettersAndNumbers`(input VARCHAR(255)) RETURNS varchar(255) CHARSET utf8mb4
begin
	DECLARE letters VARCHAR(255) DEFAULT '';

    DECLARE i INT DEFAULT 1;
 
    WHILE i <= CHAR_LENGTH(input) DO
        IF ASCII(SUBSTRING(input, i, 1)) BETWEEN 65 AND 90 OR ASCII(SUBSTRING(input, i, 1)) BETWEEN 97 AND 122 THEN
            SET letters = CONCAT(letters, SUBSTRING(input, i, 1));


        END IF;
        SET i = i + 1;
    END WHILE;
 

   RETURN letters;
END//
DELIMITER ;

