	(47, 231, 'cbs-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: cbs-auth\n          uri: lb://cbs-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - CacheRequestFilter\n            - ValidateCodeFilter\n            - StripPrefix=1\n        # 代码生成\n        - id: cbs-modules-gen\n          uri: lb://cbs-modules-gen\n          predicates:\n            - Path=/code/**\n          filters:\n            - StripPrefix=1\n        # 定时任务\n        - id: cbs-modules-job\n          uri: lb://cbs-modules-job\n          predicates:\n            - Path=/schedule/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: cbs-modules-system\n          uri: lb://cbs-modules-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n        # 文件服务\n        - id: cbs-modules-file\n          uri: lb://cbs-modules-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - StripPrefix=1\n        # FilingSystem系统模块\n        - id: cbs-modules-filingsystem\n          uri: lb://cbs-modules-filingsystem\n          predicates:\n            - Path=/filingsystem/**\n          filters:\n            - StripPrefix=1    \n\n# 安全配置\nsecurity:\n  # 验证码\n  captcha:\n    enabled: true\n    type: math\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /system/notice\n  # 不校验白名单\n  ignore:\n    whites:\n      - /auth/logout\n      - /auth/login\n      - /auth/register\n      - /*/v2/api-docs\n      - /csrf\n      - /auth/aad/test\n      - /auth/aad/launch\n      - /auth/aad/reply/code/cbs\n      - /auth/aad/login\n      - /filingsystem/file/test\ncbs:\n  redis:\n      host: filingSystemRedis.redis.cache.chinacloudapi.cn\n      port: 6380\n      password: oix7h